import React, { Component } from "react";

export default class Footer extends Component {
  render() {
    return (
      <footer>
        <div>
          <p>Website Design & Developed by Will Ferrufino.</p>
          <p>Made in Austin, Texas</p>
        </div>
        <div>
          <p>HTML5, Sass, ReactJS</p>
        </div>
      </footer>
    );
  }
}
